script: |
  super -f text -I q10159.spq | sort > q10159.out

inputs:
  - name: q10159.spq
    data: |
      SELECT + + col2 AS col1 FROM tab2 (FORMAT parquet) WHERE + ( + + CAST ( NULL AS INTEGER ) ) NOT IN ( 17, col2 - - + col0 * col0 + + - col0 * - + col0 + ( + - col0 ) );
  - name: tab2

outputs:
  - name: q10159.out
    data: |
